# Code to mock the dalle server

import munch
import json
import time
import random

def get_black_image_result(batch_size=1):
  return get_fake_dalle_result(black_img, batch_size)

def get_ada_image_result(batch_size=1):
  return get_fake_dalle_result(ada_img, batch_size)

def get_fake_dalle_result(b64_img, batch_size, sleep=True):
  json_data = {
      "b64_images": [b64_img for _ in range(batch_size)]
  }
  json_bytes = json.dumps(json_data).encode('utf-8')
  if sleep:
    time.sleep(random.randint(1, 30) * 0.1)
  return munch.Munch({
    "status": 200,
    "data": json_bytes
  })

